class Solution:
    def isValid(s: str) -> bool:    
        if len(s)%2 == 1:
            return False
        cashe = []
        hash_table = {
            '}':'{',
            ']':'[',
            ')':'('
        }
        for i in s:
            # print(i)
            if i in '{[(':
                cashe.append(i)
                # print(cashe)
            elif i in '}])':
                if len(cashe) == 0:
                    return False
                if hash_table[i] == cashe.pop():
                    continue
                else:
                    return False

        if len(cashe) != 0:
            return False
        else:
            return True

